//Red Rider Race Report//

//AMATEUR MX//

The AMA Amateur National Motocross Championship at Loretta Lynn Ranch wrapped up over the weekend, and Honda Red Rider Trackside Support was onsite with assistance from Phoenix Racing Honda. @phxracinghonda 

Red Riders took home several AMA National Championships. Phoenix Racing Honda's Heath Harrison @heath.harrison of Salisbury, North Carolina, captured the Junior (25+) National Championship, going 1-2-2 in his motos. In the 450 B class, Chase Prince @_chaseprince of Petersburg, Tennessee, went 3-1-1 to secure the National Championship. Another National Championship was claimed by Broc Peterson @broc399 of Delta, Ohio, in the Vet (30+) class, where he went 1-1-2.

Hunter Yoder @hunteryoder58 of Menifee, California, went 6-6-7 to grab fifth in 250 Pro Sport. Yoder also claimed fifth in Open Pro Sport, going 6-8-8. Fellow Red Rider Cullin Park @cullinpark43 of Clermont, Florida, went 8-5-5 to lock up fourth in the Open Pro Sport class. Preston Boespflug @prestonboespflug_28 of Battle Ground, Washington, took fourth in the 250 B class with 5-4-3 finishes. Christopher McMillin @christophermcmillon of Sturgis, Michigan, captured fifth in the Senior (40+) class, going 11-8-8.

//SXS//

The DR. Powersports @dr.powersports team captured two top-10 finishes at Iowa ATV Hare Scramble Series' Heartland Challenge in Fort Dodge, Iowa, where Chad Deutsch and Justin Steck @steckracing18 raced their Honda Talons in the Open class. When the checkers flew, Deutsch just missed the podium -- ending with a fourth-place finish. Steck actually led, only for his race ended at hour 3 when a run-in put him in an official finishing position of sixth place.

//MXGP//

For the third time in his highly successful career, Team HRC’s Tim Gajser @tiga243 won the MXGP of Latvia on board his Honda CRF450RW. The #243 rider stayed solid and consistent, going 2-2 for first overall, and more than doubling his MXGP championship points lead in the process.

